/**
 * Credit limit view mode - "emptied" of "filled".
 * - "emptied" - Starts full (filled with primary color). As credit card gets used, the progress bar empties from right to left.
 * - "filled" - Starts empty (filled with secondary color). As credit card gets used, the progress bar fills from left to right.
 */
export declare type CreditLimitViewMode = 'emptied' | 'filled';
